INSERT INTO `catalog_product_entity_text` (`value_id`, `entity_type_id`, `attribute_id`, `store_id`, `entity_id`, `value`) VALUES
(1797, 4, 72, 0, 547, '<p>\n	120A Breaker</p>\n'),
(1798, 4, 83, 0, 547, NULL),
(1799, 4, 73, 0, 547, '<p>\n	120A Breaker</p>\n'),
(1800, 4, 106, 0, 547, NULL),
(1801, 4, 72, 0, 548, '<p>\n	150A Breaker</p>\n'),
(1802, 4, 83, 0, 548, NULL),
(1803, 4, 73, 0, 548, '<p>\n	150A Breaker</p>\n'),
(1804, 4, 106, 0, 548, NULL),
(1805, 4, 72, 0, 549, '<p>\n	Air Tool Coupler</p>\n'),
(1806, 4, 83, 0, 549, NULL),
(1807, 4, 73, 0, 549, '<p>\n	Air Tool Coupler</p>\n'),
(1808, 4, 106, 0, 549, NULL),
(1809, 4, 72, 0, 550, '<p>\n	Air Tool Nipple</p>\n'),
(1810, 4, 83, 0, 550, NULL),
(1811, 4, 73, 0, 550, '<p>\n	Air Tool Nipple</p>\n'),
(1812, 4, 106, 0, 550, NULL),
(1813, 4, 72, 0, 551, 'Alarm PIR - Motion Sensor'),
(1814, 4, 83, 0, 551, NULL),
(1815, 4, 73, 0, 551, 'Alarm PIR - Motion Sensor'),
(1816, 4, 106, 0, 551, NULL),
(1817, 4, 72, 0, 552, '<p>\n	One set comes with both the magnet and the sending unit. These will work for most applications including any Provan or Summit Bodywork truck.</p>\n'),
(1818, 4, 83, 0, 552, NULL),
(1819, 4, 73, 0, 552, '<p>\n	Alarm Sending Unit</p>\n'),
(1820, 4, 106, 0, 552, NULL),
(1821, 4, 72, 0, 553, '<p>\n	This belt is for mid 2006 to mid 2007 single alternator GMC C-5500&rsquo;s with the secondary a/c compressor on the driver side of the motor. 1360K6</p>\n'),
(1822, 4, 83, 0, 553, NULL),
(1823, 4, 73, 0, 553, '<p>\n	C-5500 136 inch&nbsp;6 Groove Serpentine Belt</p>\n'),
(1824, 4, 106, 0, 553, NULL),
(1825, 4, 72, 0, 554, '<p>\n	C-5500 149in 6 Groove Serpentine Belt.&nbsp; Used for 2004 to mid 2006 dual alternator GMC C-5500&#39;s.</p>\n<p>\n	149 inch PV6 - 1490K6</p>\n'),
(1826, 4, 83, 0, 554, NULL),
(1827, 4, 73, 0, 554, '<p>\n	<strong>Dual Alternator Belt 1490K6</strong></p>\n'),
(1828, 4, 106, 0, 554, NULL),
(1829, 4, 72, 0, 555, '<p>\n	These pulleys will work on 2004 to mid 2006 dual alternator GMC C-5500&rsquo;s. They come with spacers and bolts to ensure proper installation. These pulleys are made with a different composite then the original pulley. This allows them to hold up the heat better so that the bearings last longer. 21099IP</p>\n'),
(1830, 4, 83, 0, 555, NULL),
(1831, 4, 73, 0, 555, '<p>\n	C-5500 Aftermarket Pulley Kit (Dual Alternator)</p>\n'),
(1832, 4, 106, 0, 555, NULL),
(1833, 4, 72, 0, 556, '<p>\n	This pulley will work on mid 2006 to mid 2007 GMC C-5500&rsquo;s with single alternator and secondary compressor on the driver side of the motor. It comes with spacers and bolts to ensure proper installation. This pulley is made with a different composite then the original pulley. This allows them to hold up the heat better so that the bearings last longer. 21098IP</p>\n'),
(1834, 4, 83, 0, 556, NULL),
(1835, 4, 73, 0, 556, '<p>\n	C-5500 Aftermarket Pulley Kit (Single Alternator)</p>\n'),
(1836, 4, 106, 0, 556, NULL),
(1837, 4, 72, 0, 557, '<p>\n	This battery charger provides up to 80A of charging current for 12 volt systems. Built-in features such as electronic current limiting, reverse battery protection, high voltage protection, low voltage operation, and over temperature shut down ensure long term reliability. Features: Reverse Battery Protection Deliver filtered DC power to all 12 volt lighting and appliance circuits, providing safe and reliable service. Electronic Current Limiting Lower Line Voltage Protection Variable Speed Intelligent Cooling Fan High Voltage Protection Automatic Thermal Shutdown Built-in Total Charge Management System (TCMS) Connector 2 Year Limited Warranty</p>\n'),
(1838, 4, 83, 0, 557, NULL),
(1839, 4, 73, 0, 557, '<p>\n	Converter Intellipower 9100</p>\n'),
(1840, 4, 106, 0, 557, NULL),
(1841, 4, 72, 0, 558, '<p>\n	This deadbolt will replace any Alfred body deadbolts which are on most of the Provan and Summit Bodyworks tool trucks. Some applications may need some alterations.</p>\n'),
(1842, 4, 83, 0, 558, NULL),
(1843, 4, 73, 0, 558, '<p>\n	Replacement Deadbolt</p>\n'),
(1844, 4, 106, 0, 558, NULL),
(1845, 4, 72, 0, 559, '<p>\n	Door Catch</p>\n'),
(1846, 4, 83, 0, 559, NULL),
(1847, 4, 73, 0, 559, '<p>\n	Door Catch</p>\n'),
(1848, 4, 106, 0, 559, NULL),
(1849, 4, 72, 0, 560, '<p>\n	These are the standard e-track&nbsp; rachet straps that come with all Summit Bodywork trucks.</p>\n<p>\n	2in. x 20ft.</p>\n'),
(1850, 4, 83, 0, 560, NULL),
(1851, 4, 73, 0, 560, '<p>\n	Ratcheting Tool Box Straps</p>\n'),
(1852, 4, 106, 0, 560, NULL),
(1853, 4, 72, 0, 561, '<p>\n	Three speed, Reversible. Select speed (1-low, 2-medium or 3-high). Select fan-blade direction (OUT-exhaust or IN-for air intake). Open dome manually with hand knob. When opened approximately 2&quot;, fan blade is activated. Placing the IN/OUT switch in the center (neutral) position can turn off fan blade.</p>\n'),
(1854, 4, 83, 0, 561, NULL),
(1855, 4, 73, 0, 561, '<p>\n	Fantastic Roof Vent</p>\n'),
(1856, 4, 106, 0, 561, NULL),
(1857, 4, 72, 0, 562, '<p>\n	Rotaire register is molded from durable ABS plastic in a variety of colors. The damper mechanism can be easily opened and closed and may be completely removed for full flow. Grill rotates a full 360&deg; to direct air flow where desired. 4&quot; dia. mounting collar; overall 5&quot; dia. by 2-1/4&quot; D. 65592</p>\n'),
(1858, 4, 83, 0, 562, NULL),
(1859, 4, 73, 0, 562, '<p>\n	Furnace Vent 4&quot; Plastic, Brown</p>\n'),
(1860, 4, 106, 0, 562, NULL),
(1861, 4, 72, 0, 563, '<p>\n	Warning: Please call if you are trying to upgrade your Inverter to a bigger size so that we can be sure that your truck is wired correctly. If you are going from a 600-800 watt inverter to anything bigger, alterations must be made . Also if you are wanting to run a laser jet printer you will want to purchase a pure sine wave Inverter, not a modified one.</p>\n'),
(1862, 4, 83, 0, 563, NULL),
(1863, 4, 73, 0, 563, '<p>\n	1750 watt Modified Inverter</p>\n'),
(1864, 4, 106, 0, 563, NULL),
(1865, 4, 72, 0, 564, '<p>\n	This is the replacement for the 800 watt cobra inverters that you may currently have on your tool truck. The 600 watt is all you need if you are running a laptop, credit card machine and printer (not laser jet).</p>\n'),
(1866, 4, 83, 0, 564, NULL),
(1867, 4, 73, 0, 564, '<p>\n	600 watt Modified Inverter</p>\n'),
(1868, 4, 106, 0, 564, NULL),
(1869, 4, 72, 0, 565, '<p>\n	Locking Handle with Push-Button Lock.</p>\n<p>\n	Key is not required to lock this handle. Just push cylinder in to lock.</p>\n<p>\n	This is the standard outside side door (sliding) handle on the Provan and Summit bodyworks trucks. This has a four hole mounting bracket.</p>\n<p>\n	Chrome handle 3/8&quot; x 3-3/4&quot; shaft.</p>\n'),
(1870, 4, 83, 0, 565, NULL),
(1871, 4, 73, 0, 565, '<p>\n	Handle, Locking with Push Button</p>\n'),
(1872, 4, 106, 0, 565, NULL),
(1873, 4, 72, 0, 566, '<p>\n	<font face="Helvetica-Condensed-Black" size="4"><font face="Helvetica-Condensed-Black" size="4">Locking Handle</font></font></p>\n<p align="left">\n	<font face="Helvetica-Condensed-Black" size="4"><font face="Helvetica-Condensed-Black" size="4">with No Lock-Out Cylinder</font></font></p>\n<p>\n	<b><font face="Helvetica-Bold" size="2"><font face="Helvetica-Bold" size="2"><span _fck_bookmark="1" style="display: none">&nbsp;</span><span _fck_bookmark="1" style="display: none">&nbsp;</span> </font></font></b></p>\n<p>\n	<b><font face="Helvetica-Bold" size="2"><font face="Helvetica-Bold" size="2">(Driver must turn key to lock handle)</font></font></b></p>\n<p>\n	<b><font face="Helvetica-Bold" size="2"><font face="Helvetica-Bold" size="2"><font face="Helvetica" size="1"><font face="Helvetica" size="1">5/16&quot; x 3-3/4&quot; shaft</font></font></font></font></b></p>\n<p align="left">\n	<b><font face="Helvetica-Bold" size="2"><font face="Helvetica-Bold" size="2"><font face="Helvetica" size="1"><font face="Helvetica" size="1"><font face="Helvetica" size="1"><font face="Helvetica" size="1">Mounting holes</font></font></font></font></font></font></b></p>\n<p align="left">\n	<b><font face="Helvetica-Bold" size="2"><font face="Helvetica-Bold" size="2"><font face="Helvetica" size="1"><font face="Helvetica" size="1"><font face="Helvetica" size="1"><font face="Helvetica" size="1">measure 2-3/8&quot;</font></font></font></font></font></font></b></p>\n<p>\n	<b><font face="Helvetica-Bold" size="2"><font face="Helvetica-Bold" size="2"><font face="Helvetica" size="1"><font face="Helvetica" size="1"><font face="Helvetica" size="1"><font face="Helvetica" size="1">center to center.</font></font></font></font></font></font></b></p>\n<p>\n	<b><font face="Helvetica-Bold" size="2"><font face="Helvetica-Bold" size="2"><font face="Helvetica" size="1"><font face="Helvetica" size="1"><font face="Helvetica" size="1"><font face="Helvetica" size="1">This is the standard outside side door (swing) handle on the Provan and Summit bodyworks trucks. This handle features a key to lock function so that no one locks your door on accident. You have to use the key in order to lock and unlock this handle. This has a two hole mounting bracket.</font></font></font></font></font></font></b></p>\n<p>\n	<span _fck_bookmark="1" style="display: none">&nbsp;</span><span _fck_bookmark="1" style="display: none">&nbsp;</span></p>\n'),
(1874, 4, 83, 0, 566, NULL),
(1875, 4, 73, 0, 566, '<p>\n	Handle, Outside Locking Key (Key to Lock Handle)</p>\n'),
(1876, 4, 106, 0, 566, NULL),
(1877, 4, 72, 0, 567, '<p>\n	This is the standard outside side door (swing) handle on the Provan and Summit bodyworks trucks. This has a two hole mounting bracket.</p>\n'),
(1878, 4, 83, 0, 567, NULL),
(1879, 4, 73, 0, 567, '<p>\n	Kason Outside Swing Door Handle</p>\n'),
(1880, 4, 106, 0, 567, NULL),
(1881, 4, 72, 0, 568, '<p>\n	This is the same ramp that comes stock on all Summit Bodyworks trucks. It allows you to roll your toolbox over the void between your liftgate and the rear door.</p>\n'),
(1882, 4, 83, 0, 568, NULL),
(1883, 4, 73, 0, 568, '<p>\n	Liftgate Ramp 32&quot;</p>\n'),
(1884, 4, 106, 0, 568, NULL),
(1885, 4, 72, 0, 569, '<p>\n	Fits all Provan and Summit Bodyworks applications.</p>\n'),
(1886, 4, 83, 0, 569, NULL),
(1887, 4, 73, 0, 569, '<p>\n	Liftgate Remote</p>\n'),
(1888, 4, 106, 0, 569, NULL),
