(1916, 4, 106, 0, 576, NULL),
(1917, 4, 72, 0, 577, '<p>\n	LP Furnace, 8500-IV Series, 35K BTU, 12-Volt, Used on Mobile or Recreational Vehicles, Furnace Only.</p>\n'),
(1918, 4, 83, 0, 577, NULL),
(1919, 4, 73, 0, 577, '<p>\n	LP Furnace</p>\n'),
(1920, 4, 106, 0, 577, NULL),
(1921, 4, 72, 0, 578, '<p>\n	LP Sniffer (New).&nbsp; This detector is the one now being used here at Summit Bodyworks. Having an inline solenoid at the lp tank is no longer regulation. This is a basic power and ground detection device.</p>\n'),
(1922, 4, 83, 0, 578, NULL),
(1923, 4, 73, 0, 578, '<p>\n	LP Leak Detector</p>\n'),
(1924, 4, 106, 0, 578, NULL),
(1925, 4, 72, 0, 579, '<p>\n	LP Tank (Propane), 14 x 48 SF Vapor Appliance.&nbsp;</p>\n<p>\n	This tank is the same one that is on all Summit Bodyworks and Provan tool trucks in the field. It does not come with any of the regulators or fittings. Tank only.</p>\n'),
(1926, 4, 83, 0, 579, NULL),
