(2384, 4, 106, 0, 693, NULL),
(2385, 4, 72, 0, 694, '<p>\n	Diesel Furnace 12-Volt</p>\n<p>\n	<b><i><font face="Helvetica-BoldOblique" size="1"><font face="Helvetica-BoldOblique" size="1">AIRTRONIC D4 </font></font></i></b></p>\n<p align="left">\n	<b><i><font face="Helvetica-BoldOblique" size="1"><font face="Helvetica-BoldOblique" size="1"><font face="Helvetica" size="1"><font face="Helvetica" size="1">This heater is uniquely designed for inside mounting and ease of installation.</font></font></font></font></i></b></p>\n<p align="left">\n	<b><i><i><font size="1"><font size="1"><font face="Times New Roman">The AIRTRONIC </font></font></font></i><font face="Helvetica" size="1"><font face="Helvetica" size="1">D4 is a 13,650 BTU/hr air heater for larger</font></font></i></b></p>\n<p>\n	<b><i><font face="Helvetica" size="1"><font face="Helvetica" size="1">bunks. </font></font></i></b></p>\n<p align="left">\n	<b><i><font face="Helvetica" size="1"><font face="Helvetica" size="1"><font face="Helvetica" size="1"><font face="Helvetica" size="1">These heaters provide hot air to the interior of vehicles for passenger</font></font></font></font></i></b></p>\n<p align="left">\n	<b><i><font face="Helvetica" size="1"><font face="Helvetica" size="1"><font face="Helvetica" size="1"><font face="Helvetica" size="1">comfort. The heater runs on diesel fuel and are available in</font></font></font></font></i></b></p>\n<p align="left">\n	<b><i><font face="Helvetica" size="1"><font face="Helvetica" size="1"><font face="Helvetica" size="1"><font face="Helvetica" size="1">12 or 24 volt versions, it is able to provide space heat completely</font></font></font></font></i></b></p>\n<p>\n	<b><i><font face="Helvetica" size="1"><font face="Helvetica" size="1"><font face="Helvetica" size="1"><font face="Helvetica" size="1">independently of the vehicle engine. </font></font></font></font></i></b></p>\n<p align="left">\n	<b><i><font face="Helvetica" size="1"><font face="Helvetica" size="1"><font face="Helvetica" size="1"><font face="Helvetica" size="1"><font face="Helvetica" size="1"><font face="Helvetica" size="1">Various control options are available to operate the heater. It cycles</font></font></font></font></font></font></i></b></p>\n<p align="left">\n	<b><i><font face="Helvetica" size="1"><font face="Helvetica" size="1"><font face="Helvetica" size="1"><font face="Helvetica" size="1"><font face="Helvetica" size="1"><font face="Helvetica" size="1">through four heat output modes (boost-high-medium-low) in order to</font></font></font></font></font></font></i></b></p>\n<p>\n	<b><i><font face="Helvetica" size="1"><font face="Helvetica" size="1"><font face="Helvetica" size="1"><font face="Helvetica" size="1"><font face="Helvetica" size="1"><font face="Helvetica" size="1">maintain the desired temperature.</font></font></font></font></font></font></i></b></p>\n'),
