(2549, 4, 72, 0, 735, '<p>\n	<strong>Inverter, Go-Power 2500 Modified Sine</strong></p>\n<p>\n	<strong>Specifications:</strong></p>\n<p>\n	Continuous output power: 2500 Watts</p>\n<p>\n	Surge power capability (peak power): 3600 Watts</p>\n<p>\n	dc input / operating voltage: 10 to 15 Volts</p>\n<p>\n	Output voltage: 120 Volts ac</p>\n<p>\n	Battery low voltage alarm: 10.5 +/- 0.5 Volts</p>\n<p>\n	Battery low voltage shutdown: 10.0 +/- 0.5 Volts</p>\n<p>\n	No load power consumption: 0.8A</p>\n<p>\n	Full load efficiency: 90%</p>\n<p>\n	1/3 load efficiency: 95%</p>\n<p>\n	AC Output Socket Type: dual Type 2 -3 prong</p>\n<p>\n	High input voltage protection: 15V</p>\n<p>\n	Low input voltage shutdown: 10V</p>\n<p>\n	Product size (L x W x H): 18.7&rdquo;X 9.5&rdquo;X 3.5&rdquo;</p>\n<p>\n	Inverter Weight 13.5 lbs.<br />\n	&nbsp;</p>\n<p>\n	Ideal for powering several appliances, or as a source of emergency back-up power, the Go Power! GP-2500 is suitable for a range of applications: <br />\n	<br />\n	*Utility trucks <br />\n	*RVs and Campers <br />\n	*Long haul trucks <br />\n	*Boats <br />\n	*Mobile offices <br />\n	*Service vehicles</p>\n'),
(2550, 4, 83, 0, 735, NULL),
